import { Route } from "react-router-dom";
import Home from "./Home";
import ReviewDay from "./ReviewDay";


function App() {
  return (
    <div className="App">
      <Route path="/" exact>
        <Home/>
      </Route>

      <Route path="/reviewday/:day" exact component={ReviewDay}>
        <ReviewDay/>
      </Route>
    </div>
  );
}

export default App;
